import React from "react";

import styles from "./Contact.module.css";
import { getImageUrl } from "../../utils";
import mail from "../../../assets/contact/gmail.png"

export const Contact = () => {
  return (
    <footer id="contact" className={styles.container}>
      <div className={styles.text}>
        <h2>Contact</h2>
        <p>Feel free to reach out!</p>
      </div>
      <ul className={styles.links}>
        <li className={styles.link}>
          <img src={"../"} alt="Email icon" />
          <a href="mailto:manankhandelwal@gmail.com" target="blank">
            manankhandelwal35@gmail.com
          </a>
        </li>
        <li className={styles.link}>
          <img
            src={getImageUrl("contact/linkedinIcon.png")}
            alt="LinkedIn icon"
          />
          <a href="https://www.linkedin.com/in/manan-khandelwal-63a07122b/" target="blank">Manan</a>
        </li>
        <li className={styles.link}>
          <img src={getImageUrl("contact/githubIcon.png")} alt="Github icon" />
          <a href="https://www.github.com/manan132" target="blank">Manan132</a>
        </li>
      </ul>
    </footer>
  );
};
